import React, { Component, Fragment } from 'react';
import logo from './logo.svg';
import './App.css';
import {establishments} from './fixtures'
class App extends Component {
  render() {
    //créer un constante qui contiendra ce que la fonction map appliquera sur tout les éléments du tableau
    //dans notre cas la constante contiendra les info du tableau en JSX ce qui permettra de les afficher par la suite à l'aide du return
    const listEstablishement = establishments.map((establishment)=>{
      return(
        <li>
            key = {establishment.id }
        </li>
      )
    })
    return (
      <Fragment>
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <h2>Welcome to { this.props.title }</h2>
          <p>{ this.props.phrase }</p>
          <p>
            Happy Drink<code>(Bad Propaganda)</code> 
          </p>
        </header>
      </div>

      <establishments />
      </Fragment>
    );
  }
}

export default App;
